messages.content:
@everyone Estamos tentando começar uma nova era na Star, focar bastante nos comando dela, suporte e muito mais.

Só que tem uma coisa que nos vem chateando um pouco. A Star não sai desses  630 servidores e ver que ela não está crescendo como deveria desanima bastante, então eu peço, se você tem um servidor ou conhece um amigo que tem um, mostra a Star pra ele, mostra pra ele alguns comandinhos que fazem vcs rirem, talvez isso dê uma animada na equipe e ficaremos animados em trazer mais updates

Link pra Adicionar a Star: https://discord.com/oauth2/authorize?client_id=719524114536333342&scope=bot&permissions=805432446

@everyone Desculpa pelo ping.

Estou aqui para esclarecer oque aconteceu, o dono da EveCloud (Hiekki#6438), quebrou inúmeras vezes a regras do servidor, hoje ele divulgou o servidor da EveCloud no chat principal e foi banido por mim. Ao ser banido, cometeu uma atitude de criança e desligou os servidores da Star deixando ela offline. Fomos tentar resolver a situação, mas o mesmo se tornou agressivo e demostrou mais ainda atitudes de criança, quando disse pra ele tomar cuidado com o token ele me bloqueou indicando que ia fazer algo, então por segurança tivemos que retirar a Star da hospedagem e procurar outra. graças ao @​TiaGoiNsaNy , ele conseguiu comprar outra hospedagem, chamada Lexy, cujo o dono foi muito educado e gentil ao contrario do Hiekki, e nos forneceu a host.

Então, sempre quando forem hospedar o seu bot, certifique-se que é confiável

```exports.run = (client, message, args) => {

    message.channel.send(`Meu Ping **${client.ws.ping}**`)

}

exports.help = {
    name: "ping",
    aliases: "ms"
}```
